import SelectSearch from 'react-select-search';
import React from 'react';

const options = [
    {name: 'User1', value: '1'},
    {name: 'User2', value: '2'}
];

export default function SelectSearchUsers(props)
{
    return (<SelectSearch options={options} value="sv" placeholder="Choose user..." onChange={props.onChange}/>)
}
